import React from "react";
import { Link } from "react-router-dom";
import { createUser } from "../api/Api";



const Register = () => {
    const [username, setUsername] = useState("")
    const [password, setPassword] = useState('')
    const [password2, setPassword2] = useState('')


    const handleRegister= () => {
        if (password !== password2) {
            console.log("Your passwords do not match")
        } else {
            createUser(username, password)






        }
    }



    return (
        <div className="register-container">
        <div>Register An Account!</div>

        <form onSubmit={handleRegister} className="register-form">

        <label>Username</label>
        <input value={username} type="username"></input>

        <label value={password} onChange={(event) => setPassword2(event.target.value)} type="password">Password</label>
        <input type="password"></input>

        <label value={setPassword2}  onChange={(event) => setPassword2(event.target.value)}type="password">Confirm Password</label>
        <input type="password"></input>

        </form>


        <h3>Already have an account? <Link to="/login">Log in!</Link> </h3>
        </div>
    )
}









export default Register
